علي النونو، (مواليد 7 يونيو 1980م في صنعاء) لاعب كرة قدم يمني معتزل، بدأ مسيرته الكروية مع نادي أهلي صنعاء في عام 1995م، ولعب معهم حتى عام 1998م، ومن ثم انتقل الى الدوري المصري ثم بعد ذلك عاد الى نادي اهلي صنعاء عام 2004م انتقل إلى نادي المريخ السوداني وهناك كانت انطلاقته الحقيقية حيث استطاع إثبات نفسه وخطف الأنظار بمردود جيد داخل وخارج المستطيل الأخضر حتى أنه عرض عليه الجواز السوداني ليلعب كلاعب محلي لكنه فضل الانتقال إلى نادي البسيتين البحريني، وفي موسم 2006 - 2007 انتقل إلى نادي تشرين السوري، ومنذ عام 2007م وهو يلعب مع أهلي صنعاء حتى اعلان اعتزالة عام 2014م .
.
